import React from "react";
import Card from "../Card/Card";
import styles from "./Order.module.scss";


const Order = ({ item}) => {

  return (
    <div className='cards'>
        <h3>Заказ</h3>
        {item.map(obj=>
        <Card
    key = {obj.title}
    id = {obj.id}
    hash = {obj.hash}
    title={obj.title}
    imgURL={obj.imgURL}
    description={obj.description}
    price={obj.price}
    >
  </Card>)}

    </div>
  )

};

export default Order;
